import React from 'react';
import { MapContainer, TileLayer } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import '../css/todaydust.css';

const TodayDust = () => {
  return (
    <div className="today-container">
      <header className="today-header">
        <h1>TodayDust Page</h1>
      </header>

      <main className="today-content">
        <p>오늘의 미세먼지 지도</p>

        <div className="map-container">
          <MapContainer center={[36.5, 127.5]} zoom={7} scrollWheelZoom={true}>
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
          </MapContainer>
        </div>

        <p>측정일시: 2024-12-13 12:00</p>

        <p>사용자 맞춤 분석</p>
        <button className="AI-button">AI 분석 페이지 이동</button>
      </main>

      <button className="main-button">Main</button>
    </div>
  );
};

export default TodayDust;
